import React from 'react';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import PhoneIcon from '@material-ui/icons/Phone';
import FavoriteIcon from '@material-ui/icons/Favorite';
import PersonPinIcon from '@material-ui/icons/PersonPin';
import HelpIcon from '@material-ui/icons/Help';
import ShoppingBasket from '@material-ui/icons/ShoppingBasket';
import ThumbDown from '@material-ui/icons/ThumbDown';
import ThumbUp from '@material-ui/icons/ThumbUp';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import styles from './tabs.module.css';
import { Divider, Grid } from '@material-ui/core';
import FriendList from '../../components/friendList/FriendList';
import { WhatDoYouThing } from '../../components/whatdoyouthing/WhatDoYouThing';
import { Button } from 'antd';

const useStyles = makeStyles((theme) => ({

}));
function TabPanel(props) {
    const { children, value, index, ...other } = props;

    return (
        <div
            role="tabpanel"
            hidden={value !== index}
            id={`scrollable-prevent-tabpanel-${index}`}
            aria-labelledby={`scrollable-prevent-tab-${index}`}
            {...other}
        >
            {value === index && (
                <Box p={3}>
                    <Typography>{children}</Typography>
                </Box>
            )}
        </div>
    );
}

TabPanel.propTypes = {
    children: PropTypes.node,
    index: PropTypes.any.isRequired,
    value: PropTypes.any.isRequired,
};

function a11yProps(index) {
    return {
        id: `scrollable-prevent-tab-${index}`,
        'aria-controls': `scrollable-prevent-tabpanel-${index}`,
    };
}



export function TabList() {
    const classes = useStyles();
    const [value, setValue] = React.useState(0);

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };

    return (
        <div className={classes.root}>
            <Grid container>
                <Grid item xs={8} style={{ padding: "1%" }}>
                    <Tabs
                        value={value}
                        onChange={handleChange}
                        scrollButtons="off"
                        aria-label="scrollable prevent tabs example"
                        centered
                        variant="fullWidth"
                        style={{
                            width: "100%"
                        }}
                    >
                        <Tab sty label="Bài viết" {...a11yProps(0)} />
                        <Tab label="Giới thiệu" {...a11yProps(1)} />
                        <Tab label="Bạn bè" {...a11yProps(2)} />
                        <Tab label="Ảnh" {...a11yProps(3)} />

                    </Tabs>
                </Grid>
                <Grid item xs={4} style={{ padding: "1%" }}>
                    <Button style={{ float: 'right' }} type="primary">Theo dõi</Button>
                </Grid>

                <TabPanel value={value} index={0}>
                    <Grid container>
                        <Grid item xs={4} style={{ padding: "1%" }}>
                            
                </Grid>
                        <Grid item xs={8} style={{ padding: "1%" }}>
                            {/* <Post></Post> */}


                            <WhatDoYouThing></WhatDoYouThing>
                            <FriendList></FriendList>



                        </Grid>
                    </Grid>
                </TabPanel>

                <TabPanel value={value} index={1}>
                    Item Two
        </TabPanel>
                <TabPanel value={value} index={2}>
                    Item Three
        </TabPanel>

            </Grid>
        </div>

    );
}
